import { makeStyles } from '@material-ui/core/styles'

const useStyles = makeStyles((theme) => ({
    webBlock: {
        margin: '50px 0',
        width: '100%',
        height: '100%'
    },
    switchWrapper: {
        position: 'relative',
        width: '100%',
        height: '100%',
        '& > div': {
            position: 'absolute',
            width: '100%',
            height: '100%'
        }
    }
}))

export default useStyles
